import bgCardFront from "../images/bg-card-front.png";
import bgCardBack from "../images/bg-card-back.png";
import bgMainMobile from "../images/bg-main-mobile.png";
import bgMainDesktop from "../images/bg-main-desktop.png";
import Image from "./Image";
import CardDetailsFront from "./CardDetailsFront";
import CardDetailsBack from "./CardDetailsBack";

const Header = (props) => {
  return (
    <header className="header">
      <Image
        namesOfClasses="background-header-img mobile-header-img"
        source={bgMainMobile}
        altText="header background of a purple gradient"
      />
      {/* <Image
        namesOfClasses="background-header-img desktop-header-img"
        source={bgMainDesktop}
        altText="header background of a purple gradient"
      /> */}
      <Image
        namesOfClasses="back-of-card-header-img"
        source={bgCardBack}
        altText="back of a sample credit card"
      />
      <Image
        namesOfClasses="front-of-card-header-img"
        source={bgCardFront}
        altText="front of a sample credit card"
      />
      <CardDetailsBack cardCvc="000" />
      <CardDetailsFront
        cardNumber="1234 5678 9123 0000"
        cardHolder="Jane Appleseed"
        cardExpiration="00/00"
      />
    </header>
  );
};

export default Header;
